import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import { App } from './App';

import * as serviceWorker from './serviceWorker';

const cors = require('cors');
App.use(
  cors({
  origin: "http://localhost:3000",
  // methods: ["GET", "POST"],
  })
);

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);

serviceWorker.unregister();
